import React from "react";
import styles from "./StarterPage.module.css";
import logo from "../assets/logo.png";
import friends from "../assets/friends.png";

import { Link } from "react-router-dom";

export function StarterPage() {
  return (
    <div className={styles.body}>
      <div className={styles["topNav"]}>
        <Link to="/">
          {" "}
          <img src={logo} className={styles.logo} alt="logo"></img>{" "}
        </Link>
        <div className="buttons">
          <button class="button is-text">Login</button>
          <button class="button is-ghost">Sign Up</button>
        </div>
      </div>
      <hr className={styles.hr} />
      <div className={styles.block}>
        <div className={styles["image-block"]}>
          <img
            src={friends}
            className={styles["friends-image"]}
            alt="starter_image"
          ></img>
          <h1>Don't know where to eat?</h1>
          <p>Vote among your friends and figure out where to eat!</p>
        </div>
        <p className={styles.paragraph}>Click to get started!</p>

        <Link to="/people">
          {" "}
          <button
            className={`button is-info is-rounded ${styles["start-button"]}`}
          >
            Let's Eat!
          </button>
        </Link>
      </div>
    </div>
  );
}
